import HomePage from './pages/homepage/homepage.component.jsx';

import './App.css';
import Data from './pages/homepage/info.json'
import React from 'react';

class App extends React.Component{
  constructor(){
    super()
    this.setState= {
      products:[]
    }
  }



  render(){
    return(
      <div className= "App">
        <HomePage/>
        {Data.map(products => {
          return(
            <div>
              {<h1 className='title' key={products.id}> {products.price + products.productImage + products.productName}</h1>}
            </div>
          )
        })}
      </div>
    )
  }
}

export default App;
